import './App.css';
import HeroImage from "./pictures/MagdaHero.jpg"// with import
import {Parallax,ParallaxLayer} from '@react-spring/parallax'
import { useTrail,animated } from '@react-spring/web';


function App() {
  return (
    <div>

      <div className='fixed w-screen'>
        <NavBar></NavBar>
      </div>

    <Parallax pages={2}>
      <ParallaxLayer>
        <div className=" h-screen flex justify-center items-center">
          <HeroText></HeroText>
        </div>
      </ParallaxLayer>
      <ParallaxLayer offset={1}>
        <ProjectWrapper></ProjectWrapper>
      </ParallaxLayer>
    </Parallax>
    </div>
  );

}
function NavBar(){
      return(
        <div className='font-Nunito font-thin text-2xl '>
          <nav className="flex justify-between items-center content-center">
          <a className='m-5 text-3xl flex items-center gap-1'> <span className=' bg-botticelli-800 rounded-full block w-2 h-2'></span>Magda Nemes</a>
            <ul className='flex gap-4 items-center'>
              <li >About</li>
              <li>Projects</li>
            </ul>
            <a className='mx-10'>Contact Me</a>
          </nav>
          <CreateLine></CreateLine>
        </div>
      )
}


function HeroImageDisplay(){
  const [trails, api] = useTrail(1, () => ({
    from: { opacity: 0 },
    to: { opacity: 1 },
    config: { mass: 1, tension: 300, friction: 100 }
  }));

        return(
          <div>
          {trails.map(()=>(
            <animated.div>

              <div >
                  <img src={HeroImage} className="w-56 h-auto rounded-full" alt="HeroImage"></img>
              </div>

            </animated.div>

            )
          )
          }
          </div>
        )

}


  function HeroText() {
    const [trails] = useTrail(1, () => ({
      from: { opacity: 0 },
      to: { opacity: 1 },
      config: { mass: 1, tension: 200, friction: 150 }
    }));

    return (
      <div>
        {trails.map((props,index) => (
          <animated.div style={props} key={index+1} className="  text-center font-normal ">
           <h1 className='text-gun-powder-950 text-[10rem] font-Montseratt'>Magda Nemes</h1>
           <HeroSubText></HeroSubText>
          </animated.div>
        ))}
      </div>
    );
  }

  function HeroSubText(){
    const [trails] = useTrail(1, () => ({
      from: { opacity: 0 },
      to: { opacity: 1 },
      config: { mass: 1, tension: 100, friction: 150 }
    }));

    return (
      <div>
        {trails.map((props,index) => (
          <animated.div style={props} key={index+1} className="  text-center font-normal ">
           <h1 className=' text-botticelli-800 text-[5rem] font-Nunito font-light'>Architect</h1>
          </animated.div>
        ))}
      </div>
    );
  }

  function CreateLine(){



    return( <div className='flex'>
              <span className='block w-56 h-1 border-x-1 mr-2 bg-botticelli-800 overflow-hidden'></span>
              <div>
                <span className='block w-14 h-1 border-x-1 bg-botticelli-800 overflow-hidden'></span>
                <span className='block w-14 h-1 border-x-1 bg-botticelli-800 overflow-hidden rotate-90'></span>
              </div>
            </div>
      )
  }

function ProjectWrapper(){
  return(
    <div className=' bg-green-kelp-950 rounded-2xl'>

    </div>
  )
}


export default App;
